import { Container, Link, Box } from "@mui/material";
import { useNavigate } from "react-router";

export default function NavBar() {
  const navigate = useNavigate();

  const navigateToLink = (event, link) => {
    event.preventDefault()
    navigate(link);
  }

  return (
    <>
      <Container sx={{}}>
        <Box sx={{ textDecoration: 'none', back  }}>
          <Link onClick={(event) => navigateToLink(event, "/")}> Home</Link>
          <Link onClick={(event) => navigateToLink(event, "/crypto-page")}> Crypto</Link>
        </Box>
      </Container>
    </>
  )
}
